@averlynnlim gives Silk Road Restaurants a perfect 100% score for their Peking Ducks! A groupon deal which is actually good? Yes please!

"Their peking duck is unlike the usual. The chef would wheel out the whole duck and carve the meat together with the skin on the spot and serve it to you with condiments and steamed crepe skins for you to do the wrapping yourself. A refreshing change."

http://www.thesmartlocal.com/sg/chinese-restaurants/6983-silk-road-restaurantReal Photos & Honest Reviews by local Foodies - Under the Amara Group of Restaurants, this chinese restaurants encompasses cuisines from different parts of China and has won numerous awards for their food since 2002.

